function createGrid() {
  const screenWidth = window.innerWidth;
  const screenHeight = window.innerHeight;
  for (let w = 0; screenWidth % w === 0 && w < 20; w++) {}
  for (let h = 0; screenHeight % h === 0 && h < 20; h++) {
    console.log(h);
  }
}
createGrid();
const Home = () => {
  return <div>this is the home page</div>;
};

export default Home;
